INSERT INTO `trc_email_template` (`email_template_id`, `task`, `from_address`, `reply_address`, `subject`, `message`) VALUES
(1, 'Welcome Email', 'support@taskit.co.za', 'support@taskit.co.za', 'Welcome to Bestoffert', 'Hello {user_name},{break}{break}\n\nWelcome to  Bestoffert \n{break}{break}\nYou have sussessfully signed up with us. {break} \nAs a registered user you are now able to post Tasks or Jobs that you need to be done. {break}If you would like to make some money by working as a Tasker then you need to login with your registered username and password then click on "Become a Tasker" from your dashboard, this will start the application and verification process.{break}{break}\n\nIf you need any assistance drop us an email through contact us page.\n\n{break}\n{break}\nThank You,{break}\nTASKIT Team\n'),
(2, 'New User Join', 'wes@taskit.co.za', 'wes@taskit.co.za', 'Email confirmation on TASKIT', 'Welcome {user_name}!{break}{break}\n\nYou have successfully signed up with TASKIT.{break}{break}\n\nThis is your sign up Email Address which is also your username for the website: {email} {break}{break} \nYour Password is: {password}.{break}\nPlease keep this information safe.{break}{break}\n\nPlease verify your email address by clicking on this link: {verify_email_link}.\n{break}{break}\n\nOnce logged in please go to your Profile and fill in as much information as possible. The more detail that is offered the more likely that people will trust you. A profile picture is a must, people like to know who they are dealing with, it makes everyone feel at ease. {break}{break}\n\nIf you wish to Become a Tasker:{break}{break}\n\n1. Login here: http://taskit.co.za/index.php/login \n{break}{break}\n2. Hit the "Become a Tasker" button on the Dashboard Page or on the Top menu Bar. This will take you to an application form that you need to send to us.\n{break}{break}\n3. Fill in as much information as you can about what type of Tasks or Jobs you can do, when you can do them and a little more about yourself. \n{break}{break}\n\nIf you wish to Post a Task:\n{break}{break}\n1. Login here: http://taskit.co.za/index.php/login \n{break}{break}\n2. Hit "Post a Task".\n{break}{break}\n3. Follow the on screen instructions and fill in the details of the Task you need done, including location, time and Task details/requirements.\n{break}{break}\n4. Once you have double checked it, Post the Task and you will start receiving bids, its that Simple!\n{break}{break}\nIf you need any help at all please feel free to contact us at support@taskit.co.za we are here 24/7 to assist you.\n{break}{break}\nHappy Tasking!\n{break}\nTeam TASKIT\n'),
(3, 'Forgot Password', 'support@taskit.co.za', 'support@taskit.co.za', 'Reset password request on TASKIT', 'Hello {user_name},\n\nYour request to reset your password has been submitted to TASKIT.co.za.{break}{break}\nTo Reset your password click here {reset_password_link}.\n\n{break}\n{break}\nThank You,{break}\nTASKIT Team\n'),
(4, 'Offer Time (Poster)', 'wes@taskit.co.za', 'wes@taskit.co.za', 'You have one new offer', 'Hello {poster_name},{break}{break}\n\n{worker_name} has offered {offer_price} on your task {task_name}.{break}{break}\nAre you going to accept the offer?{break}{break}\n\n{break}\n{break}\nThank You,{break}\nTASKIT Team\n'),
(5, 'Offer Time (Worker)', 'wes@taskit.co.za', 'wes@taskit.co.za', 'Offer Successfully Placed', 'Hello {worker_name},{break}{break}\n\nYour offer of {offer_price} on the task {task_name} has been successfully Placed.{break}\n\n{break}\n{break}\nThank You,{break}\nTASKIT Team\n'),
(6, 'Assign Time (Poster)', 'wes@taskit.co.za', 'wes@taskit.co.za', 'Worker Assigned for Your Task', 'Hello {poster_name},{break}{break}\n\nYou have  successfully assigned your work to {worker_name} for your task {task_name}.{break}\n{break}\nThank You,{break}\nTASKIT Team\n'),
(7, 'Assign Time (Worker)', 'wes@taskit.co.za', 'wes@taskit.co.za', 'Good News !! Task Awarded to you', 'Hello {worker_name},{break}{break}\n\nCongratulation !! You have awarded a task {task_name}.{break}\n{break}\nThank You,{break}\nTASKIT Team\n'),
(8, 'Complete Task by worker (Poster)', 'wes@taskit.co.za', 'wes@taskit.co.za', 'Task Complete by Worker', 'Hello {poster_name},{break}{break}\n\nYour assigned work has been completed by the Tasker, {worker_name} for the Task you posted: {task_name}.{break}\n\n{break}\n{break}\nThank You,{break}\nTASKIT Team\n'),
(9, 'Complete Task by worker (Worker)', 'wes@taskit.co.za', 'wes@taskit.co.za', 'Task Completed', 'Hello {worker_name},{break}{break}\n\nWell Done!{break}{break}\n\nYou have Successfully completed the task {task_name}.\n{break}\n{break}\n\nThank You,{break}\nTASKIT Team\n'),
(10, 'Complete Task by User (Poster)', 'wes@taskit.co.za', 'wes@taskit.co.za', 'Task Completed Successfully ', 'Hello {poster_name},{break}{break}\n\nYour task {task_name} has been completed successfully.{break}\n\n\n{break}\n{break}\nThank You,{break}\nTASKIT Team\n'),
(11, 'Complete Task by User (Worker)', 'wes@taskit.co.za', 'wes@taskit.co.za', 'You Completed Task  Successfully ', 'Hello {worker_name},{break}{break}\n\nThe Assigned work for task {task_name} has been approved by {poster_name}.{break}\n\n{break}\n{break}\nThank You,{break}\nTASKIT Team\n'),
(16, 'Conversation Message', 'wes@taskit.co.za', 'wes@taskit.co.za', 'New Message received for your Task', 'Hello {user_name},{break}{break}\n\nYou have received a new message from {from_name} for  the task named: {task_name}.{break}{break}\nThe Message reads as follows: {message}{break}{break}\n\n{break}\n{break}\nThank You,{break}\nTASKIT Team\n'),
(17, 'Post New Task (Poster)', 'gaumji009@gmail.com', 'gaumji009@gmail.com', 'Task Posted Successfully ', 'Hello {poster_name},{break}{break}\n\nYou have posted a new task {task_name}.{break}\n\n\n{break}\n{break}\nThank You,{break}\nTASKIT Team\n\n'),
(18, 'Post New Task (Admin)', 'gaumji009@gmail.com', 'gaumji009@gmail.com', 'New Task has been posted', 'Hello Admin,{break}{break}\n\nA new task {task_name}  has been posted  by {poster_name}.{break}\n\n\n{break}\n{break}\nThank You,{break}\nTASKIT Team\n'),
(19, 'Pay amount of Task (Poster)', 'wes@taskit.co.za', 'wes@taskit.co.za', 'Pay amount For Task', 'Hello {poster_name},{break}{break}\n\nThe amount {pay} for the new task {task_name} has been done successfully.{break}\n\n{break}\n{break}\nThank You,{break}\nTASKIT Team\n'),
(20, 'Pay amount of Task (Admin)', 'wes@taskit.co.za', 'wes@taskit.co.za', 'Pay amount for Task', 'Hello Admin,{break}{break}\n\nAmount {pay} of new task {task_name} pay by {poster_name}.{break}\n\n\n{break}\n{break}\nThank You,{break}\nTASKIT Team\n'),
(21, 'Assign Time (Admin)', 'wes@taskit.co.za', 'wes@taskit.co.za', 'Worker Assigned for a task', 'Hello Admin,{break}{break}\n\nPoster has Assigned work to {worker_name} for task {task_name} by {poster_name}.{break}\n{break}\nThank You,{break}\nTASKIT Team\n'),
(24, 'Complete Task by User (Admin)', 'wes@taskit.co.za', 'wes@taskit.co.za', 'Task Complete byWorker', 'Hello Admin,{break}{break}\n\nTask {task_name} has been completed by {worker_name} successfully.{break}\n\n\n{break}\n{break}\nThank You,{break}\nTASKIT Team\n'),
(25, 'Complete Task by worker (Admin)', 'wes@taskit.co.za', 'wes@taskit.co.za', 'Complete Task by worker', 'Hello Admin,{break}{break}\n\nTask {task_name} has been completed by {worker_name} successfully.{break}\n\n\n{break}\n{break}\nThank You,{break}\nTASKIT Team\n'),
(26, 'Worker Apply (Worker)', 'gaumji009@gmail.com', 'gaumji009@gmail.com', 'TASKIT Application Received - Thank You', 'Hello {worker_name},{break}{break}\n\nThanks for applying to become a Tasker.{break}{break}\n\nRelax :) We will review your application and get back to you soon {break}{break}\n\nPlease note: {break}\nWe often have a waiting list to become a Tasker. When this is the case, it may take some time to move through this process. We very much appreciate your patience and are expanding as fast as our cottontails can manage!\n\n \n{break}\n{break}\nThank You,{break}\nTASKIT Team\n'),
(27, 'Worker Apply (Admin)', 'gaumji009@gmail.com', 'gaumji009@gmail.com', 'New TASKER application Received', 'Hello Admin, {break}{break}\n\nA new TASKER application was received {break}{break}\n\nThank You,{break}\nTASKIT Team\n'),
(28, 'Post New Task by Category (Worker)', 'wes@taskit.co.za', 'wes@taskit.co.za', ' New Task Posted', 'Hello {worker_name},{break}{break}\n\nA New task {task_name} in {category_name} category has been posted by {poster_name}.{break}\n{break}\nYou can go and check it out perhaps make a bid?\n\n{break}\n{break}\nThank You,{break}\nTASKIT Team\n'),
(29, 'First Dibs When Post New Task (Worker)', 'wes@taskit.co.za', 'wes@taskit.co.za', 'Good News !! You are Invited ', 'Hello {worker_name},{break}{break}\n\nGood News !!!!    , You have been invited to place a bid on {task_name} \n{break}\nPlease place your bid ASAP before its assigned to someone else .\n\n\n{break}\n{break}\nThank You,{break}\nCamellar Team\n'),
(30, 'Expire Task (Poster)', 'wes@taskit.co.za', 'wes@taskit.co.za', 'Your task has been expired ', 'Hello {poster_name},{break}{break}\n\nYour task {task_name} has expired.{break}\n\n\n{break}\n{break}\nThank You,{break}\nTASKIT Team\n'),
(31, 'Expire Task (Admin)', 'wes@taskit.co.za', 'wes@taskit.co.za', 'Task has been expired ', 'Hello Admin,{break}{break}\n\nTask {task_name} posted by {poster_name} has expired.{break}\n\n{break}\n{break}\nThank You,{break}\nTASKIT Team\n'),
(32, 'AutoComplete Task (Poster)', 'wes@taskit.co.za', 'wes@taskit.co.za', 'Task Completed Successfully ', 'Hello {poster_name},{break}{break}\n\nYour task completed.{break}{break}\nTask Name            : {task_name}{break}\nTask User Name     : {user_link}{break}\nWorker User Name : {worker_link}{break}\n\n\n{break}\n{break}\nThank You,{break}\nTASKIT Team\n'),
(33, 'AutoComplete Task (Admin)', 'wes@taskit.co.za', 'wes@taskit.co.za', 'AutoComplete Task', 'Hello Admin,{break}{break}\n\nTask completed.{break}{break}\nTask Name            : {task_name}{break}\nTask User Name     : {user_link}{break}\nWorker User Name : {worker_link}{break}\n\n{break}\n{break}\nThank You,{break}\nTASKIT Team\n'),
(34, 'AutoComplete Task (Worker)', 'wes@taskit.co.za', 'wes@taskit.co.za', 'Task Completed Successfully ', 'Hello {worker_name},{break}{break}\n\nTask completed.{break}{break}\nTask Name : {task_name}{break}\nTask User Name : {user_link}{break}\nWorker User Name : {worker_link}{break}\n\n\n{break}\n{break}\nThank You,{break}\nTASKIT Team\n'),
(35, 'Additional Information', 'support@taskit.co.za', 'support@taskit.co.za', 'Additional information for the TASK', 'Hello {worker_name},{break}{break}\n\nThere is additional information that has been added to the task: {task_name} by {poster_name}.{break}{break}\n\nWe suggest that you check it out.\n{break}\n{break}\nThank You,{break}\nTASKIT Team\n'),
(36, 'Forgot Password Admin', 'support@taskit.co.za', 'support@taskit.co.za', 'Reset Password Request - TASKIT', 'Hello {user_name},\n\nYour request has been submitted to TASKIT.co.za {break}\nYour Email Address {email} and Password is {password}.{break}\nNow you can take login from {login_link}.\n\n{break}\n{break}\nThank You,{break}\nTASKIT Team\n'),
(37, 'Change Password By Admin', 'wes@taskit.co.za', 'wes@taskit.co.za', 'Change of Password for TASKIT', 'Hello {user_name},{break}{break}\n\nHope you are well.\n{break} {break}\nWe have changed your password to access TASKIT.co.za. {break} {break}\n{break} {break}\nYour New Password is: {password}{break} {break}\nPlease keep this in a safe place. Once you are logged in you may change your password to something you may prefer by going to your profile and selecting "change password". {break} {break}\nIf you have any questions or need any assistance at all please do not hesitate to contact us!\n\n{break}\n{break}\nThank You,{break}\nTASKIT Team\n'),
(38, 'Edit Offer Time (Worker)', 'wes@taskit.co.za', 'wes@taskit.co.za', 'You have edited offer', 'Hello {worker_name},{break}{break}\n\nYou have edited the offer to {offer_price} on task {task_name} successfully.{break}\n\n{break}\n{break}\nThank You,{break}\nTASKIT Team\n'),
(39, 'Edit Offer Time (Poster)', 'wes@taskit.co.za', 'wes@taskit.co.za', 'Tasker have edited offer', 'Hello {poster_name},{break}{break}\n\n{worker_name} has edited the offer to {offer_price} on your task {task_name}.{break}\n\n\n{break}\n{break}\nThank You,{break}\nTASKIT Team\n');
