truth, the master-builder of human happiness. No one rejects, dislikes, or avoids pleasure itself, because it is pleasure, but because those who do not know how to pursue pleasure rationally encounter consequences that are extremely painful. Nor again is there anyone who loves or pursues or desires to obtain pain of itself, because it is pain, but because occasionally circumstances occur in wh</p>\n</td>\n</tr>\n</tbody>\n</table>\n<p>&nbsp;</p>\n<table style="width: 700px;" border="0" cellspacing="3" cellpadding="3">\n<tbody>\n<tr>\n<td style="text-align: left;" colspan="2" align="left" valign="top"><a style="font-size: 18px; font-weight: bold; color: #114a75; text-transform: capitalize;" href="http://localhost/FundraisingscriptAmazon/projects/school-fees-for-20-young-girls-in-zimbabwe/203">School Fees for 20 Young Girls in Zimbabwe</a></td>\n</tr>\n<tr>\n<td align="left" valign="top"><a href="http://localhost/FundraisingscriptAmazon/admin/projects/school-fees-for-20-young-girls-in-zimbabwe/203" target="_blank"><img class="p_img" title="School Fees for 20 Young Girls in Zimbabwe" src="http://localhost/FundraisingscriptAmazon/upload/thumb/3047_1049225077572_1434061423_30132279_4499702_n.jpg" alt="" width="190" height="150" /></a></td>\n<td style="text-align: justify; padding: 10px;" align="left" valign="top">\n<table border="0" cellspacing="2" cellpadding="2">\n<tbody>\n<tr>\n<td style="font-size: 16px; font-weight: bold; color: #114a75;" align="center" valign="top">Goal</td>\n<td style="font-size: 16px; font-weight: bold; color: #114a75;" align="center" valign="top">Raised</td>\n<td style="font-size: 16px; font-weight: bold; color: #114a75;" align="center" valign="top">Days Left</td>\n</tr>\n<tr>\n<td style="font-size: 12px; font-weight: bold;" align="center" valign="top">$8000</td>\n<td style="font-size: 12px; font-weight: bold;" align="center" valign="top">$ RAISED</td>\n<td style="font-size: 12px; font-weight: bold;" align="center" valign="top">44 DAYS LEFT</td>\n</tr>\n<tr>\n<td colspan="3" height="18">&nbsp;</td>\n</tr>\n<tr>\n<td style="text-align: left;" colspan="3" align="left" valign="top"><span style="font-size: 16px; font-weight: bold; color: #114a75;">Summary: </span> teachings of the great explorer of the truth, the master-builder of human happiness. No one</td>\n</tr>\n</tbody>\n</table>\n</td>\n</tr>\n<tr>\n<td style="text-align: justify; padding: 10px;" colspan="2" align="left" valign="top">\n<p><span class="Apple-style-span" style="border-collapse: separate; color: #000000; font-family: ''Times New Roman''; font-size: 16px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px;"><span class="Apple-style-span" style="color: #1c1c1c; font-family: arial,helvetica,sans-serif; font-size: 14px; line-height: 19px;">You can make an incredible change in the life of a young girl in Zimbabwe by helping to put her in school. A few dollars from you will give her an amazing chance at a life with a future.You can make an incredible change in the life of a young girl in Zimbabwe by helping to put her in school. A few dollars from you will give her an amazing chance at a life with a future.</span></span></p>\n<p>&nbsp;</p>\n<h2 style="margin: 0px 0px 10px; padding: 0px; border-width: 0px; outline-width: 0px; font-size: 18px; vertical-align: baseline; background-color: transparent; color: #1c1c1c;">What is the problem the project is addressing?</h2>\n<p style="margin: 0px 0px 10px; padding: 0px; border-width: 0px; outline-width: 0px; font-size: 14px; vertical-align: baseline; background-color: transparent; line-height: 19px;">Picture Patience, a 13-year-old girl in rural Zimbabwe, working at home each day because she can'' t go to school. Her brothers go to school because her parents believe it is important for boys but not girls. Young girls like Patience who do not attend school have few options in life and are especially vulnerable and prone to all forms of abuse. They are often forced into prostitution when faced with profound economic challenges.</p>\n<h2 style="margin: 0px 0px 10px; padding: 0px; border-width: 0px; outline-width: 0px; font-size: 18px; vertical-align: baseline; background-color: transparent; color: #1c1c1c;">How will this project solve the problem?</h2>\n<p style="margin: 0px 0px 10px; padding: 0px; border-width: 0px; outline-width: 0px; font-size: 14px; vertical-align: baseline; background-color: transparent; line-height: 19px;">ASAP will assist the 20 most deserving girls selected by their community to receive a year of secondary school funding plus training in Internal Saving &amp; Lending with business skills, to enable them to self-generate the funds for the following years.</p>\n<h2 style="margin: 0px 0px 10px; padding: 0px; border-width: 0px; outline-width: 0px; font-size: 18px; vertical-align: baseline; background-color: transparent; color: #1c1c1c;">What is the potential long-term impact of this project?</h2>\n<p style="margin: 0px 0px 10px; padding: 0px; border-width: 0px; outline-width: 0px; font-size: 14px; vertical-align: baseline; background-color: transparent; line-height: 19px;">Girls who attend school have 50% less chance of contracting HIV/AIDS plus they are less vulnerable to abuse at home. They also have more self-esteem and self-confidence.</p>\n<p>&nbsp;</p>\n</td>\n</tr>\n</tbody>\n</table>\n<table style="width: 700px;" border="0" cellspacing="3" cellpadding="3">\n<tbody>\n<tr>\n<td style="text-align: left;" colspan="2" align="left" valign="top"><a style="font-size: 18px; font-weight: bold; color: #114a75; text-transform: capitalize;" href="http://localhost/FundraisingscriptAmazon/projects/help-build-a-school-and-provide-a-home-for-orphans-in-africa/161">Help build a school and provide a home for orphans in Africa</a></td>\n</tr>\n<tr>\n<td align="left" valign="top"><a href="http://localhost/FundraisingscriptAmazon/admin/projects/help-build-a-school-and-provide-a-home-for-orphans-in-africa/161" target="_blank"><img class="p_img" title="Help build a school and provide a home for orphans in Africa" src="http://localhost/FundraisingscriptAmazon/upload/thumb/5.jpg" alt="" width="190" height="150" /></a></td>\n<td style="text-align: justify; padding: 10px;" align="left" valign="top">\n<table border="0" cellspacing="2" cellpadding="2">\n<tbody>\n<tr>\n<td style="font-size: 16px; font-weight: bold; color: #114a75;" align="center" valign="top">Goal</td>\n<td style="font-size: 16px; font-weight: bold; color: #114a75;" align="center" valign="top">Raised</td>\n<td style="font-size: 16px; font-weight: bold; color: #114a75;" align="center" valign="top">Days Left</td>\n</tr>\n<tr>\n<td style="font-size: 12px; font-weight: bold;" align="center" valign="top">$5000</td>\n<td style="font-size: 12px; font-weight: bold;" align="center" valign="top">$ RAISED</td>\n<td style="font-size: 12px; font-weight: bold;" align="center" valign="top">44 DAYS LEFT</td>\n</tr>\n<tr>\n<td colspan="3" height="18">&nbsp;</td>\n</tr>\n<tr>\n<td style="text-align: left;" colspan="3" align="left" valign="top"><span style="font-size: 16px; font-weight: bold; color: #114a75;">Summary: </span> Lessons in computer programming and English fluency were previously unavailable to school</td>\n</tr>\n</tbody>\n</table>\n</td>\n</tr>\n<tr>\n<td style="text-align: justify; padding: 10px;" colspan="2" align="left" valign="top">\n<p>Matunda Cultural Tourism Project is a non-governmental, non-profit organization that runs under the management of Ndoombo&mdash;Mfulony villagers through their representatives. The project was founded by Unambwe Zephania Kaaya, a professional wildlife guide/tutor and community leader in 2000, who was born and raised in the area. Due to the difficulties and problems he saw facing the local people, Mr. Kaaya proposed the establishment of the Matunda Cultural Tourism Project for the benefit of the entire community. Ndoombo&mdash;Mfulony are two different villages situated in the northeastern part of the Arumeru district on the slopes of Mount Meru. These villages are located about 25 km from the big city of Arusha, Tanzania. The current population among these villages is estimated to be about 14,000 people and 2,500 livestock.<br /> <br /> These villages have orphans, homeless, abandoned, and mentally disabled children that need an education but cannot afford the school fees. Some of the children are HIV orphans and others have parents that simply cannot afford to pay for their childrens'' education. Mentally disabled children are basically abandoned when it comes to education in Tanzania, mainly because their caretakers cannot sponsor them. However, these children are able to do the same subjects as the other kids but just need specially trained teachers to assist them. As a result, Matunda Cultural Tourism and Safaris Organization took the first step by establishing a school for all of the above mentioned children.<br /> <br /> Currently, there is a one room classroom that hosts fifty children ranging from the ages of 3-7 years old. There is an additional building being built adjacent to the school that will serve as another classroom and also an orphanage for those kids in need. There is one permanent teacher on staff, which makes it hard to teach such a wide range of ages and skill levels. After all, the 3 year olds can barely form their letters and the 7 year olds are able to read and write. Having all of these children in the same classroom tends to result in either frustration or boredom for the children, and is clearly not an ideal academic environment. The goal of the Matunda Cultural Tourism Project is to keep expanding the school''s facilities, through the help of its volunteers.<br /> <br /> This fundraising effort will help with the building of several more classrooms and the construction of a live-in orphanage. The orphanage will be a welcome addition, as it will provide the students with a stable home. In the meantime, Kaaya has arranged for the orphaned children to be taken in by a number of families in his village (as well as housing many of them himself). Some of these caretakers are aging, however, and it is becoming increasingly difficult for them to meet the needs of young, energetic children. Furthermore, many of them live far away from the school, which inhibits many of the students from going to class when the weather is bad - particularly during the rainy season. Having a stable home on the same grounds as the school will certainly be a big help.<br /> <br /> Thank you to everyone who has supported the project thus far, and please continue to spread the word. The more people that know about this project, the closer we will come to reaching our goal of providing this village with accessible schooling, and more importantly, giving these children a brighter future.<br /> <br /> If you have any questions about the project, feel free to email me: andyrosenhek@hotmail.com</p>\n</td>\n</tr>\n</tbody>\n</table>', '35046newsletter.gif', 1, 1, 161, '2011-11-08'),
