(1, 0, 'Terms and Conditions ', '<div><p mso-pagination:none"="">This agreement describes the terms and conditions (the "Terms and Conditions") applicable to the&nbsp;use of the services offered within the site www.BestOffert.com ( "BestOffert.com", "BestOffert" The "site" or "platform").&nbsp;Any person who wishes to access and / or use the site or services may do so subject to the General Terms and Conditions, along with all other policies and principles that govern BestOffert.com and are hereby incorporated by reference.</p><p mso-pagination:none"=""><br></p>\n<p>ANY PERSON DOES NOT ACCEPT THESE GENERAL TERMS AND CONDITIONS, WHICH HAVE A MANDATORY AND BINDING CHARACTER, SHOULD BE ABSENT OF USING THE SITE AND / OR THE SERVICES.&nbsp; <strong><br>\n</strong></p><p><br></p>\n<p>The User must read, understand and accept all the conditions set out&nbsp;in the General Terms and Conditions and Privacy Policy as well as other documents incorporated therein by reference, prior to its registration as a&nbsp;user BestOffert.com&nbsp;</p><p> <br>\n</p>\n<p><strong>1. Capacity<br></strong></p><p><strong><br></strong></p><p>\nThe Services are only available to persons who have legal capacity to hire.&nbsp;The services may not be used by persons who do not have that capacity, minors or BestOffert.com Users who have been temporarily suspended or permanently disabled.&nbsp;If you are registering a User as a Company, you must be able to contract on behalf of such entity and bind it under the terms of this Agreement.&nbsp;  <br>\n</p><p><br></p><p><strong>2. Object of BestOffert  Service&nbsp;</strong></p><p><strong><br></strong></p>\n<p>2.1.&nbsp;BestOffert  provides a platform to connect those who need to do a task, ("Advertisers") with those who are willing to do the work ("Taskers").&nbsp; <br>\n</p><p><br></p>\n<p>2.2.&nbsp;The term "user" or "users" in this agreement includes Advertisers of Tasks, Taskers&nbsp;and any other person who visits or sees the BestOffert.com Platform.&nbsp;  \n<br>\n</p><p><br></p>\n<p>2.3.&nbsp;Users get an account BestOffert.com when he / she completes the registration form in all fields with valid data BestOffert.com Platform&nbsp;  \n<br>\n</p><p><br></p>\n<p>2.4.&nbsp;BestOffert.com only provides the platform which allows the Advertisers to find a Taskers  to provide a service, BestOffert  accepts no responsibility for any aspect of the transaction between the parties, including, but not limited to: the description of the services Offered and efficiency in the provision of these.&nbsp;BestOffert  has no obligation to users in any dispute that may arise between the Advertisers and the Camelladores.&nbsp; <br>\n</p><p><br></p>\n<p>2.5.&nbsp;All information related to the services to be performed is provided by the Users.&nbsp;BestOffert  has no ability or responsibility to review, approve or verify any information provided by Users on the platform.&nbsp;  \n<br>\n</p><p><br></p>\n<p>2.6.&nbsp;You expressly agree that BestOffert  has no responsibility and makes no warranty as to the truthfulness or accuracy of the information provided by users (including Taskers  and Advertisers), including, but not limited to, the ability of Taskers  to perform The tasks, or the honesty or accuracy of the information provided by the Advertisers or their ability to pay for the services requested.&nbsp;</p><p>  \n<br>\n</p>\n<p><strong>3. Description of BestOffert  Service</strong></p><p><strong><br></strong></p>\n<p>3.1.&nbsp;The BestOffert  Service will be reviewed and updated from time to time.&nbsp;In addition to the points listed below, some parts of the BestOffert  Service may be described separately on the BestOffert  Platform.&nbsp;  </p><p><br></p>\n<p>3.2.&nbsp;An Advertiser who requires the completion of a task or work: (1) creates and has BestOffert  and (2) publishes the assignment, including an accurate and complete description of the service to be provided (including, but not limited to: Offers to the Taskers) ("published task").&nbsp;Published tasks are subject to other conditions set forth below, for "Posting Tasks" and "Offering".&nbsp;</p><p><br></p>\n<p>3.3.&nbsp;A Taskers, with the capacity to render the services: (1) creates an account in BestOffert, (2) registers as Taskers  and (3) revises the tasks published by the Advertisers.&nbsp;  </p><p><br></p>\n<p>3.4.&nbsp;If a Camellador wishes to render the services, he must make an offer to the published task ("Offer").&nbsp;By "Bidding", the Cambrador confirms that he / she is legally empowered and has the ability to provide the services described in the published task.&nbsp;"Offer" is subject to other conditions set forth below, for "Posting of Tasks" and "Offering".&nbsp;  </p><p><br></p>\n<p>3.5.&nbsp;If an Advertiser modifies or updates a task after it has been posted on the BestOffert   Platform and before an offer has been accepted, BestOffert   may at its discretion cancel all bids that were made for that task prior to the modification and recommence The supply process.&nbsp;  </p><p><br></p>\n<p>3.6.&nbsp;If an Advertiser wishes to accept a Tasker`s  offer, the Taskers  must do so using the "Offer" feature on the BestOffert  platform.&nbsp;&nbsp;</p><p><br></p>\n<p>3.7.&nbsp;Taskers  and Advertisers use the public comment function to ask questions and offer answers about the published camel.&nbsp;Once the Advertiser has accepted an offer by a Tasker, the private messaging service of BestOffert  can be privately communicated.&nbsp;</p>\n<p>3.8.&nbsp;Once an Advertiser has accepted an offer from a Taskers, it is an obligation on both sides.&nbsp;Del Taskers  to provide the service and the Advertiser to pay the agreed sum.&nbsp;  </p><p><br></p>\n<p>3.9.&nbsp;Once a Taskers  has provided the services requested by an Advertiser, as described in the Camel Publication, the Advertiser must "finalize" the camel inside the BestOffert  portal using the "Camel Finish" option and objectively qualify the Taskers  .&nbsp;  </p><p><br></p>\n<p>3.10.&nbsp;For security, advertisers should never disclose personal details such as address, phone number, or email address on a posted camel or any other public communication on the BestOffert  platform.</p></div>  ', 'terms-of-use', '1', 'Terms Of Use', 'Terms Of Use', '0', '0', '0', '0', '', 0),
