(5, 0, 'Privacy Policy', '<div><p><br></p></div><div><p>BestOffert SAS ("We") manage the website http://www.BestOffert.com (the "Service").</p><p><br></p></div><div><p>The following describes our policies regarding the collection, use and disclosure of personal information when you use our service.  </p><p><br></p></div><div><p>We will not use or share your information with anyone except as described in this Privacy Policy.  </p><p><br></p></div><div><p><strong>We may use your personal information to provide and improve the service.&nbsp;By using the Service, you agree that we will collect and use the information provided in accordance with this policy.  </strong></p><p><strong><br></strong></p></div><div>Unless otherwise defined in this Privacy Policy, the terms used in this Privacy Policy have the same meanings as the Terms and Conditions of Use, you find here<br></div><div><br></div><div><p><strong>Collection and use of information  </strong></p></div><div><br></div><div><p>While using our service, we may ask you to provide us with certain personally identifiable information that we may use to contact or identify you.&nbsp;Identification information may include, but is not limited to, your e-mail address, name, ID number, telephone number, postal address, other information ("Personal Information").  </p></div><div><br></div><div><p><strong>Log data  </strong></p></div><div><br></div><div><p>Our servers collect information that your browser sends each time you visit our Service ("Log Data").&nbsp;Log data can collect information such as your IP address ("IP"), type of browser, browser version, pages of our service you visit, time and date of your visit, time spent on those pages And other statistics.  </p></div><div><br></div><div><p>In addition, we may use third-party services such as Google Analytics which collects, monitors and analyzes this type of information in order to increase the functionality of our service.&nbsp;These service providers have their own privacy policies versus the way they use such information.</p><p><br></p></div><div><p><strong>cookies  </strong></p></div><div><br></div><div><p>Cookies are files with small amounts of data, which may include an anonymous unique identifier.&nbsp;Cookies are sent to your browser from a website and stored on your computer''s hard drive.</p></div><div><p>Our servers may use "cookies" to collect information.&nbsp;You can set your browser to reject all cookies or to indicate when a cookie is sent.&nbsp;However, if you do not accept cookies, you may not be able to use some parts of our service.</p><p><br></p></div><div><p><strong>Service Providers  </strong></p></div><div><br></div><div><p>We may use the services of third parties to facilitate our service, to provide the service on our behalf, to perform services related to the service or to help us analyze how our service is used.  </p></div><div><br></div><div><p>These third parties have access to your personal information only to carry out these tasks on our behalf and are required not to disclose or use it for any other purpose.  </p></div><div><br></div><div><p><strong>Communications  </strong></p></div><div><br></div><div><p>We may use your personal information to contact you with newsletters, promotional material and other information that may be of interest to you.&nbsp;You may choose not to receive any or all of these communications from us by following the unsubscribe link or the instructions provided in any email we send or by contacting us.  </p></div><div><br></div><div><p><strong>Compliance with laws  </strong></p></div><div><br></div><div><p>We will release your personal information when required by law or if we believe such action is necessary to comply with the law or to protect the safety or integrity of our service.</p></div><div><br></div><div><p><strong>Security  </strong></p></div><div><br></div><div><p>The security of your personal information is important to us, but remember that no method of transmission over the Internet or method of electronic storage is 100% secure.&nbsp;While we strive to use commercially acceptable means to protect your personal information, we can not guarantee your absolute security.  </p></div><div><br></div><div><p><strong>International transfer of your information  </strong></p></div><div><br></div><div><p>Your information, including personal information, may be transferred to - and maintained at - computers that are located outside your country where data protection laws may be different from those in your country.  </p></div><div><br></div><div><p>If you are outside Colombia and choose to provide information to us, please note that we transfer this information, including your personal information, to Colombia and process it there.  </p></div><div><br></div><div><p>Your consent to this Privacy Policy represents acceptance of the transfer.  </p></div><div><br></div><div><p><strong>Hyperlinks to other Pages  </strong></p></div><div><br></div><div><p>Our Service may contain hyperlinks to other sites not operated by us.&nbsp;If you click on a link from a third party, you will be directed to the third party site.&nbsp;We recommend that you review the Privacy Policy of each site you visit.  </p></div><div><br></div><div><p>We have no control over the sites or services of third parties and assume no responsibility for the content, policies or privacy practices of these.  </p></div><div><br></div><div><p><strong>Privacy of minors  </strong></p></div><div><br></div><div><p>You must not allow minors to register and use our service.&nbsp;("Minors").  </p></div><div><br></div><div><p>We do not collect personally identifiable information from minors.&nbsp;If you are a parent or guardian and have knowledge that your children have provided us with personal information, please contact us.&nbsp;If we become aware that we have collected personal information from minors without the consent of their parents, we will take steps to remove such information from our servers.  </p></div><div><br></div><div><p><strong>Changes to this Privacy Policy</strong></p></div><br><div><p>We may update our privacy policy from time to time.&nbsp;We will notify you of any changes by posting the new Privacy Policy on this page.  <br></p><p>You are advised to review this Privacy Policy periodically for any changes to the service.&nbsp;Changes to this Privacy Policy are effective when posted on this page.  </p></div><div><br></div><div><p><strong>Contact us  </strong></p></div><div><br></div><div><p>If you have any questions about this Privacy Policy, please <a href="http://saivisiontech.com/newsitepro/index.php/contact_us">contact us</a></p><p><br></p></div>  ', 'privacy', '1', '', 'TASKIT.co.za - Privacy Policy', '0', '0', '0', '0', 'http://taskit.co.za/privacy', 0),
